import {Link} from 'nex/link';

const linkStyle = {
    marginRight: 15
}

export default () => {

    return (
        <div id="header">
             <Link href="/">
                <a style={linkStyle}>Home</a>
            </Link>
            <Link href="/about">
                <a style={linkStyle}>About</a>
            </Link>
        </div>
    )
}
